import React from 'react';
import './App.css';
import {Members} from './components/MembersData';
import CalendarModal from './components/CalendarModal';

function App() {
  let displayUsers = Members.members.map((item)=>{
  return (<React.Fragment>
  <div className="card bg-light text-dark" data-toggle="modal" data-target={'#modal'+item.id} key={item.id}>
    <div className="card-body">{item.real_name}</div>
  </div>
         <CalendarModal member={item}/></React.Fragment>)
  })
  return (
    <div className="App">
      <div className="container">
        <h2>Basic List Group</h2>
        <ul className="list-group">
          {displayUsers}
        </ul>

      </div>
    </div>
  );
}

export default App;
